import React, { Component } from 'react'
import Header from './Header'
import HomePage from './HomePage'
import { Switch, Route, Link } from 'react-router-dom'

class App extends Component {
  render() {
      return (
        <div className='app'>
          <Header />
          <HomePage />

          <Switch>
            <Route exact/>
          </Switch>
        </div>
      )
  }
}

export default App
